import classes from './ArchiveContent.module.css';
import ArchiveClasses from '../ArchiveClasses';

const ArchiveTheory = () => {
  return (
    <div className={classes.Theory}>
      <div className={classes.TabHead}>Теоретический тур</div>
      <a className={classes.ClassesItem}>9 класс</a>
      <a className={classes.ClassesItem}>10 класс</a>
      <a className={classes.ClassesItem}>11 класс</a>
    </div>
  )
}

export default ArchiveTheory;
